import React from 'react';
import { Link } from 'react-router-dom';

function LandingPage() {
  return (
    <div style={{
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '24px',
      minHeight: '100vh',
      backgroundColor: '#121212'
    }}>
      {/* Navbar */}
      <nav style={{
        position: 'fixed',
        top: 0,
        left: 0,
        right: 0,
        backgroundColor: '#1a1a1a',
        padding: '16px 24px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        zIndex: 1000
      }}>
        <div style={{
          display: 'flex',
          alignItems: 'center',
          gap: '16px'
        }}>
          <img 
            src="/assets/logo.png" 
            alt="Logo" 
            style={{
              width: '40px',
              height: '40px'
            }}
          />
          <h1 style={{ 
            margin: 0,
            fontSize: '24px',
            color: '#fff'
          }}>EduBlock</h1>
        </div>
        
        <div style={{
          display: 'flex',
          gap: '16px'
        }}>
          <Link 
            to="/login" 
            style={{
              color: '#fff',
              textDecoration: 'none',
              fontSize: '16px',
              transition: 'color 0.2s'
            }}
          >
            Login
          </Link>
          <Link 
            to="/create-account" 
            style={{
              color: '#fff',
              textDecoration: 'none',
              fontSize: '16px',
              transition: 'color 0.2s'
            }}
          >
            Create Account
          </Link>
        </div>
      </nav>

      {/* Hero Section */}
      <div style={{
        textAlign: 'center',
        padding: '48px 0',
        marginTop: '80px' // Add space for fixed navbar
      }}>
        <h1 style={{ 
          margin: 0,
          fontSize: '48px',
          color: '#fff',
          marginBottom: '24px'
        }}>Smart Lecture Management</h1>
        <p style={{
          fontSize: '24px',
          color: '#888',
          marginBottom: '48px',
          maxWidth: '600px',
          margin: '0 auto'
        }}>Automatically record, summarize, and organize your lectures for better student engagement and accessibility</p>
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          gap: '24px'
        }}>
          <Link to="/login" style={{
            padding: '12px 24px',
            fontSize: '18px',
            backgroundColor: '#007bff',
            color: '#fff',
            textDecoration: 'none',
            borderRadius: '8px',
            transition: 'background-color 0.2s'
          }}>Get Started</Link>
        </div>
      </div>

      {/* Features Section */}
      <div style={{
        backgroundColor: '#1a1a1a',
        borderRadius: '16px',
        padding: '32px',
        marginTop: '48px'
      }}>
        <h2 style={{ 
          fontSize: '32px',
          color: '#fff',
          marginBottom: '24px',
          textAlign: 'center'
        }}>How It Works</h2>
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
          gap: '24px'
        }}>
          <div style={{
            backgroundColor: '#2d2d2d',
            borderRadius: '16px',
            padding: '24px',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '48px',
              marginBottom: '16px'
            }}>üé§</div>
            <h3 style={{ 
              fontSize: '24px',
              color: '#fff',
              marginBottom: '12px'
            }}>Lecture Recording</h3>
            <p style={{ color: '#888' }}>
              Automatically record and save your lectures in high quality audio and video.
            </p>
          </div>

          <div style={{
            backgroundColor: '#2d2d2d',
            borderRadius: '16px',
            padding: '24px',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '48px',
              marginBottom: '16px'
            }}>üìù</div>
            <h3 style={{ 
              fontSize: '24px',
              color: '#fff',
              marginBottom: '12px'
            }}>Smart Summarization</h3>
            <p style={{ color: '#888' }}>
              AI-powered summaries of your lectures, highlighting key points and concepts.
            </p>
          </div>

          <div style={{
            backgroundColor: '#2d2d2d',
            borderRadius: '16px',
            padding: '24px',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '48px',
              marginBottom: '16px'
            }}>üìö</div>
            <h3 style={{ 
              fontSize: '24px',
              color: '#fff',
              marginBottom: '12px'
            }}>Organized Access</h3>
            <p style={{ color: '#888' }}>
              All your lectures are neatly organized by date, course, and topic for easy access.
            </p>
          </div>

          <div style={{
            backgroundColor: '#2d2d2d',
            borderRadius: '16px',
            padding: '24px',
            textAlign: 'center'
          }}>
            <div style={{
              fontSize: '48px',
              marginBottom: '16px'
            }}>üëÇ</div>
            <h3 style={{ 
              fontSize: '24px',
              color: '#fff',
              marginBottom: '12px'
            }}>Student Access</h3>
            <p style={{ color: '#888' }}>
              Students can review missed lectures, access summaries, and study at their own pace.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LandingPage;
